You can add source codes at an arbitrary position in the project directory. This is because Veryl project can be independent or integrated to other SystemVerilog project. The extension of Veryl's source codes is .veryl. For example, put the following code to src/hello.veryl. module ModuleA { initial { $display("Hello, world!"); }
} $ tree
